import React, { useId } from "react";

export const FlowerCartAddress = () => {
  const addressID = useId();

  return (
    <article className="Flowers__Cart__DeliveryInfo">
      <label for={`${addressID}_address`}>Address to deliver:</label>
      <input type="address" id={`${addressID}_address`} />
      <label for={`${addressID}_time`}>Better to deliver on:</label>
      <select id={`${addressID}_time`} name="Delivery time">
        <option>12-14</option>
        <option>14-16</option>
        <option>16-18</option>
        <option>18-20</option>
        <option>20-22</option>
      </select>
    </article>
  );
};
